class Solution:
    def solution(self, stdin: str) -> str:
        lines = stdin.split('\n')
        n_stores = int(lines[0])
        store_items = {}
        for i in range(1, n_stores + 1):
            store_items[i - 1] = lines[i].split()

        items_purchased = lines[n_stores + 1:]

        for item in items_purchased:
            found = False
            for store_index, store_item in store_items.items():
                for i in range(len(store_item)):
                    if store_item[i] == item:
                        store_item.pop(i)
                        found = True
                        break
                if found:
                    break
            if not found:
                return "impossible"

        unique = True
        for store_item in store_items.values():
            if store_item:
                unique = False
                break

        return "unique" if unique else "ambiguous"

